import Games from "../pages/Games";
import MyAccount from "../pages/MyAccount";
import MyLibrary from "../pages/MyLibrary";
import News from "../pages/News";
import Settings from "../pages/Settings";

// Declarando as rotas para renderizar os item de acordo com a rota
const routesHeader = [
  {
    name: "Home",
    path: "/",
    component: `${(<Games />)}`,
  },
  {
    name: "News",
    path: "/news",
    component: "<News />",
  },
  {
    name: "Settings",
    path: "/settings",
    component: "<Settings />",
  },
];

const routesSidebar = [
  {
    name: "My Account",
    path: "/account",
    component: "<MyAccount />",
  },
  {
    name: "All Games",
    path: "/",
    component: "<Games />",
  },
  {
    name: "My Library",
    path: "/library",
    component: "<MyLibrary />",
  },
];

const routes = [...routesHeader, ...routesSidebar];
export { routesHeader, routesSidebar, routes };
